import React, { Component } from 'react';
import './Home.sass';
import { Grid, Paper, Typography, Input, Button } from '@material-ui/core';
import { Done, Clear }  from '@material-ui/icons'
import ItemPanel from '../../components/ItemPanel/ItemPanel'


class Home extends Component {
    constructor(props) {
        super(props);
        this.setState({
            items: [
                {
                    name: 'Potato',
                    amount: 10,
                    cost: 10
                },
                {
                    name: 'Potato',
                    amount: 10,
                    cost: 10
                },
            ]
        })
    }

    renderItems() {
        const items = this.state.items.map((i) => {
           return <ItemPanel key item={i} />
        });
    }

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container spacing={24} alignItems={"center"} direction={"column"} wrap={"nowrap"}>
                    <Grid item container xs={12} sm={12} md={6} lg={6}>
                        <Paper className={'headPanel'}>
                            <Grid container wrap="nowrap" spacing={16}>
                                <Grid item xs={6}>
                                    <Input placeholder="Name" className={'nameInput'} required/>
                                </Grid>
                                <Grid item xs>
                                    <Input placeholder="Amount" className={'secondaryInput'}/>
                                </Grid>
                                <Grid item xs>
                                    <Input placeholder="Cost" className={'secondaryInput'}/>
                                </Grid>
                                <Grid item>
                                    <Button variant="contained" color="primary">
                                        Add
                                    </Button>
                                </Grid>
                            </Grid>
                        </Paper>
                    </Grid>
                    <Grid item container className={'itemsContainer'} direction={"column"} alignItems={"center"} xs={12} sm={12} md={6} lg={6}>
                        <ItemPanel item={{name: '1', amount: '1', cost: '1'}}/>
                    </Grid>

                </Grid>
            </div>
        );
    }
}
export default Home;
